h()(),d(28,", j\u2019ai mis en application l\u2019utilisation de GIT avec trois autres de mes camarades. Cela nous a permis de collaborer efficacement et d'avoir des versions stables de l\u2019application. Quand nous devions pr\xe9senter l\u2019\xe9volution de l\u2019application aux diff\xe9rents acteurs du projet, une semaine avant la pr\xe9sentation, nous nous arr\xeations sur une version fonctionnelle que nous conservions pour la pr\xe9sentation. Cela nous a permis de continuer \xe0 d\xe9velopper de nouvelles fonctionnalit\xe9s tout en ayant une version stable et test\xe9e pour la pr\xe9sentation. Ainsi, nous avons \xe9vit\xe9 d\u2019avoir des bugs dus \xe0 des d\xe9veloppements faits la veille lors de la pr\xe9sentation. "),h(),f(29,"p"),d(30,' Lors de mon alternance, j\u2019ai \xe9galement pu me rendre compte des bienfaits de GIT dans une \xe9quipe plus cons\xe9quente et qui utilise la m\xe9thodologie agile. En effet, \xe0 chaque d\xe9but de sprint, l\u2019\xe9quipe part de la derni\xe8re version que nous appelons "develop". Chaque d\xe9veloppeur cr\xe9e une branche pour impl\xe9menter la nouvelle fonctionnalit\xe9 sur laquelle il travaille. Au fur et \xe0 mesure que les d\xe9veloppements sont termin\xe9s, nous fusionnons la fonctionnalit\xe9 avec la branche "develop". Ainsi, "develop" \xe9volue et embarque toutes les nouvelles fonctionnalit\xe9s. \xc0 la fin du sprint, nous cr\xe9ons une version correspondant \xe0 "develop" plus toutes les fonctionnalit\xe9s d\xe9velopp\xe9es au cours du sprint qu\u2019on nomme release. '),h(),f(31,"p"),d(32,' Il m\u2019est arriv\xe9 de travailler sur le m\xeame fichier qu\u2019un autre d\xe9veloppeur. GIT a permis de d\xe9tecter les conflits entre les diff\xe9rents changements, et nous avons d\xfb les r\xe9soudre tout en conservant l\u2019int\xe9grit\xe9 de chaque fonctionnalit\xe9 avant de pouvoir fusionner sur la branche "develop". Ainsi, GIT a permis d\'\xe9viter d\u2019\xe9craser le d\xe9veloppement d\u2019un autre d\xe9veloppeur. '),h()(),f(33,"section",5)(34,"h4"),d(35,"Mon niveau actuel : "),h(),f(36,"p"),d(37," J\u2019ai un niveau confirm\xe9 en GIT, que j\u2019ai acquis suivant diff\xe9rents projets en \xe9tudes sup\xe9rieures, mais c\u2019est en entreprise, lors de mon alternance, que j\u2019ai le plus progress\xe9, car j\u2019ai \xe9t\xe9 confront\xe9 \xe0 une utilisation de GIT \xe0 grande \xe9chelle et avec une courte formation aupr\xe8s de mes coll\xe8gues, j\u2019ai pu facilement appr\xe9hender les bonnes pratiques. En tant qu'expert en ing\xe9nierie logicielle, la ma\xeetrise de Git est essentielle puisqu\u2019il est pr\xe9sent dans la majorit\xe9 des projets actuels. "),h()(),f(38,"section",5)(39,"h4"),d(40,"Prise de recul : "),h(),f(41,"p"),d(42," Lors de mes \xe9tudes, je n\u2019ai pas exploit\xe9 Git \xe0 son plein potentiel. Je le consid\xe9rais uniquement comme un simple outil de collaboration, sans en explorer toutes les fonctionnalit\xe9s essentielles. Cependant, mon alternance m\u2019a fait prendre conscience de son importance et de la richesse des outils qu\u2019il propose. "),h(),f(43,"p"),d(44," Le meilleur conseil que je peux donner est de ne pas se limiter au strict minimum avec Git. Peu importe la taille du projet, il est crucial d\u2019exploiter ses fonctionnalit\xe9s avanc\xe9es pour am\xe9liorer son workflow et optimiser la gestion du code. "),h(),f(45,"p"),d(46," Git est aujourd\u2019hui un outil incontournable pour tout d\xe9veloppeur, pr\xe9sent sur la quasi-totalit\xe9 des projets. C\u2019est pourquoi je souhaite approfondir mes comp\xe9tences en suivant la formation expert Git sur Udemy. Cette certification me permettra d\u2019atteindre un niveau avanc\xe9 et de mieux ma\xeetriser cet outil essentiel. "),h()(),f(47,"h4"),d(48,"R\xe9alisation associ\xe9es : : "),h(),f(49,"section",5)(50,"button",7),d(51,"Geosavior"),h(),f(52,"button",7),d(53,"Babylone"),h(),f(54,"button",7),d(55,"Extends"),h(),f(56,"button",7),d(57,"Transurvey"),h(),f(58,"button",7)